import React, { useState, useEffect } from "react";
import "./Resume.css";

function Resume() {
  const [click, setClick] = useState(false);
  const handleClick = () => {
    console.log("Change click from " + click.toString());
    setClick(!click);
  };

  return (
    <div className="all">
      <video src="/videos/video-1.mp4" autoPlay loop muted />
      <h1 className="header">
        <span className="hey">Hey,</span> I'm
        <br />
        Priel
      </h1>
      <div class="primary-btn">
        <div class="btn-group">
          <div class="play-btn">
            <div class="play-btn-inner">
              <i class="fa fa-play"></i>
              <span onClick={handleClick}>Watch Resume</span>
            </div>
          </div>
        </div>
      </div>
      <img
        className={click ? "no-display" : "ResumePhoto"}
        src="images/PrielHazanResume.jpg"
        alt="Priel Hazan Resume"
      />

      <h1 className="header">
        <span className="hey">Hey,</span> I'm
        <br />
        Priel
      </h1>
      <img
        className="ResumePhoto"
        src="images/PrielHazanResume.jpg"
        alt="Priel Hazan Resume"
      />
    </div>
  );
}

export default Resume;
